import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

export default function Videos({videos}) {
    console.log(videos)
  return (
    <View>
      {videos.map((item,idx)=>(        
        <View key={idx}>
        <Image
            style={styles.image}
            source={{uri:item.snippet.thumbnails.high.url}}
          />
        </View>
        ))}

    </View>
  )
}

const styles = StyleSheet.create({
    image:{
        height:280,
        width:"100%"  
      }
})
